import React from "react";
import { Card } from "antd";
import { RetweetOutliend } from "@ant-design/icons";

const PostCard = ({ post }) => {
  return (
    <div>
      <Card
        cover={
          post.Images[0] && (
            <PostImaegs images={post.Images} actions={[<RetweetOutliend />]} />
          )
        }
      >
        <Content />
      </Card>
      <CommentForm />
      <Comments />
    </div>
  );
};

export default PostCard;
